      <a href={props.liveLink}>
      </a>
        <p>{props.desc}</p>

          <p>
          {props.liveLink ? <><a href={props.liveLink}>View Live</a><br/></> : ""}

            

            {props.link ? <a href={props.link}>View On GitHub</a> : ""}
            
          </p>
    
  </div>;
}
